def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    agg_blocks = []
    new_items = []

    for block in data.blocks:
        locs = block.mgr_locs.as_array
        try:
            result, _ = self.grouper.aggregate(
                block.values, how, axis=1, min_count=min_count
            )
        except NotImplementedError as e:
            if alt is None:
                raise e
            else:
                # Handle aggregation with alternative method
                result = alt(block, axis=self.axis)

        # Adjust the dtype if needed
        result = maybe_convert_objects(result, convert_dates=False,
                                       convert_numeric=not is_extension_array_dtype(result))

        # Create the aggregated block
        agg_block = make_block(result, placement=locs)
        agg_blocks.append(agg_block)
        new_items.append(locs)

    if not agg_blocks:
        raise DataError("No numeric types to aggregate")

    return agg_blocks, data.items
